		'strl_checkbox_field_more_google_fonts_render',
		'pluginPage',
		'strl_pluginPage_section'
	);

	add_settings_field(
		'strl_checkbox_field_change_login',
		__( 'Change backend look&feel', 'wordpress' ),
		'strl_checkbox_field_change_login_render',
		'pluginPage',
		'strl_pluginPage_section'
	);

	add_settings_field(
		'strl_checkbox_field_wrap_gravity_message_html',
		__( 'Wrap Gravity Forms notifications in &lt;html&gt;', 'wordpress' ),
		'strl_checkbox_field_wrap_gravity_message_html_render',
		'pluginPage',
		'strl_pluginPage_section'
	);

	add_settings_field(
		'strl_checkbox_field_disable_emojis',
		__( 'Disable emojis', 'wordpress' ),
		'strl_checkbox_field_disable_emojis_render',
		'pluginPage',
		'strl_pluginPage_section'
	);

	add_settings_field(
		'strl_checkbox_field_disable_attachement_comments',
		__( 'Disable attachement comments', 'wordpress' ),
		'strl_checkbox_field_disable_attachement_comments_render',
		'pluginPage',
		'strl_pluginPage_section'
	);

	add_settings_field(
		'strl_checkbox_field_defer_javascript',
		__( 'Defer parsing of Javascript', 'wordpress' ),
		'strl_checkbox_field_defer_javascript_render',
		'pluginPage',
		'strl_pluginPage_section'
	);

