		'pluginPage',
		'strl_pluginPage_section'
	);

	add_settings_field(
		'strl_checkbox_field_reenable_text_widget',
		__( 'Re-enable Text Widget in SiteOrigin', 'wordpress' ),
		'strl_checkbox_field_reenable_text_widget_render',
		'pluginPage',
		'strl_pluginPage_section'
	);

	add_settings_field(
		'strl_checkbox_field_undisable_auto_updates',
		__( 'Un-disable auto updates', 'wordpress' ),
