		var element = event.currentTarget;
		element.clicks = (element.clicks || 0) + 1;
		console.log(element.clicks);
		if (element.clicks % 1 === 0) {document.getElementById('strl_bad_touch').play();}
		if (element.clicks % 5 === 0) {document.getElementById('strl_dont_touch').style.display = "block";}
		if (element.clicks % 5 != 0) {document.getElementById('strl_dont_touch').style.display = "none";}
	});
